import React from 'react';
import './tic.css';

class TTT extends React.Component{
    constructor(props){
        super(props);
        this.state={};
        this.clicked=this.clicked.bind(this);
    }
    clicked(id){
        console.log(id);
    }
    componentDidMount(){
        console.log(this.props.info);
    }
    render(){
        return(
            <div style={{textAlign:'center'}}>
            <h5>You are up against {this.props.info.Challenger.name}</h5>
             <table id="board">
                <tr>
                    <td id="00"onClick={()=>this.clicked(this.id)}></td>
                    <td id="01"onClick={()=>this.clicked(this.id)}></td>
                    <td id="02"></td>
                </tr>
                <tr>
                    <td id="10"onClick={()=>this.clicked(this.id)}></td>
                    <td id="11"onClick={()=>this.clicked(this.id)}></td>
                    <td id="12"onClick={()=>this.clicked(this.id)}></td>
                </tr>
                <tr >
                    <td id="20"onClick={()=>this.clicked(this.id)}></td>
                    <td id="21"onClick={()=>this.clicked(this.id)}></td>
                    <td id="22"onClick={()=>this.clicked(this.id)}></td>
                </tr>
                </table>
            </div>
        )
    }
}


export default TTT
